import { useEffect, useState } from "react";
import api from "../services/api.js";
import styled from "styled-components";
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import "../../styles/App.css";
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';


const Grid = styled.div`
  width: 300px;
  height: 430px;
  margin: 5px 20px;
`
function EngineInfo() {

  return (
    <div>

    </div>
  );
}

function Motor() {
  const [models, setModels] = useState([]);
  const [open, setOpen] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  

  useEffect(() => {
    api.get("assets").then((response) => {
      console.log("motor", response.data);
      setModels(response.data);
    });
  }, []);

  return (
    <div className="container grid grid-template-columns">
      
      {models.map((models, key) => {
        return (
          <>

          <Grid>
          <Card sx={{ maxWidth: 500,  }}>
          <CardActionArea onClick={EngineInfo } >
            <CardMedia
              component="img"
              height="300"
              image={models.image}
              alt="engine image"
            />
            <CardContent >
            <Button variant="outlined" onClick={handleClickOpen}>
          Open alert dialog
        </Button>
        <Dialog
          open={open}
          onClose={handleClose}
          aria-labelledby="alert-dialog-title"
          aria-describedby="alert-dialog-description"
        >
          <DialogTitle id="alert-dialog-title">
            {"Use Google's location service?"}
          </DialogTitle>
          <DialogContent>
            <DialogContentText id="alert-dialog-description">
              Let Google help apps determine location. This means sending anonymous
              location data to Google, even when no apps are running.
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button onClick={handleClose}>Disagree</Button>
            <Button onClick={handleClose} autoFocus>
              Agree
            </Button>
          </DialogActions>
        </Dialog>
              <Typography gutterBottom variant="h5" component="div">
                {models.name}
              </Typography>
              <Typography variant="body2" color="text.secondary">
              üíñ {models.healthscore}%
              </Typography>
              <Typography variant="body2" color="text.secondary">
              ‚ö°{models.status}
              </Typography>
              <Typography variant="body2" color="text.secondary">
              üå°Ô∏è{models.specifications.maxTemp}¬∞C
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
        </Grid>     
        </>           
        );
      })}
      </div>
  );
}

export default Motor;
